import React from "react";
import GTest from "./components/GTest";

const App = () => {
    return (
        <div className="App">
            <GTest name={"James"} lastName={"Doe"} dateOfBirth={"10-11-1993"}/>

            <button>-</button>
            <h2>0</h2>
            <button>+</button>
        </div>
    );
};

export default App;
